// Função para expandir dados
function expandBroker(compact: CompactBroker): Broker {
  return {
    cnpj: compact[0],
    code: compact[1],
    name: compact[2],
    manager: compact[3],
  };
}

// Buscar corretor por CNPJ, código ou razão social
export function searchBroker(query: string): Broker[] {
  if (!query || query.length < 3) return [];
  
  const lowerQuery = query.toLowerCase().replace(/[^a-z0-9]/g, '');
  
  return BROKERS_DATA
    .filter(b => {
      const cnpjClean = b[0].replace(/[^0-9]/g, '');
      const codeClean = b[1].toLowerCase();
      const nameClean = b[2].toLowerCase();
      
      return cnpjClean.includes(lowerQuery) ||
             codeClean.includes(lowerQuery) ||
             nameClean.includes(lowerQuery);
    })
    .slice(0, 20)
    .map(expandBroker);
}

// Obter gestor pelo nome
export function getManagerByName(name: string): Manager | undefined {
  const lowerName = name.toLowerCase();
  return MANAGERS.find(m => m.name.toLowerCase().includes(lowerName));
}

// Obter contato do gestor de um corretor
export function getManagerContact(managerName: string): Manager | undefined {
  // Mapear nomes da planilha para os gestores cadastrados
  const nameMap: Record<string, string> = {
    'LAIS MARTINS': 'Laís Martins',
    'PABLO AMORA': 'Pablo Amora',
    'JONATHAN LEAL': 'Jonathan Leal',
    'AGATHA SAKAMOTO': 'Agatha Sakamoto',
  };
  
  const mappedName = nameMap[managerName.toUpperCase()];
  if (mappedName) {
    return MANAGERS.find(m => m.name === mappedName);
  }
  
  // Tentar busca parcial
  return MANAGERS.find(m => 
    m.name.toLowerCase().includes(managerName.toLowerCase().split(' ')[0])
  );
}
